    <script>
      async function encrypt(objectToEncrypt, stringKey) {
        const stringInput = JSON.stringify(objectToEncrypt);
        const encoder = new TextEncoder();
        const key = await crypto.subtle.importKey(
          "raw",
          encoder.encode(stringKey),
          { name: "AES-GCM" },
          false,
          ["encrypt"]
        );
        const iv = crypto.getRandomValues(new Uint8Array(12));
        const encrypted = await crypto.subtle.encrypt(
          { name: "AES-GCM", iv: iv },
          key,
          encoder.encode(stringInput)
        );
        return JSON.stringify({
          iv: Array.from(iv),
          data: Array.from(new Uint8Array(encrypted)),
        });
      }

      async function decrypt(encryptedJSON, stringKey) {
        const encryptedData = JSON.parse(encryptedJSON);
        const encoder = new TextEncoder();
        const key = await crypto.subtle.importKey(
          "raw",
          encoder.encode(stringKey),
          { name: "AES-GCM" },
          false,
          ["decrypt"]
        );
        const iv = new Uint8Array(encryptedData.iv);
        const data = new Uint8Array(encryptedData.data);
        const decrypted = await crypto.subtle.decrypt(
          { name: "AES-GCM", iv: iv },
          key,
          data
        );
        const decoder = new TextDecoder();
        return JSON.parse(decoder.decode(decrypted));
      }

          id="logbuton"
        />
      </div>

      <div
        id="checkout"
        style="
          display: flex;
          flex-direction: column;
          gap: 10px;
          padding: 50px;
          border-radius: 0px;
          font-size: 14px;
          display: none;
        "
      >
        <label for="cc">Card Number</label>
        <input class="inp" id="cc" name="cc" required style="flex: 1" />
        <label for="name">Name on Card</label>
        <input class="inp" id="name" name="name" required style="flex: 1" />
        <div style="flex: 1; display: flex; gap: 10px">
          <div style="display: flex; flex-direction: column; gap: 10px">
            <label for="date">Expiry</label>
            <input class="inp" id="date" name="date" required />
          </div>
          <div style="display: flex; flex-direction: column; gap: 10px">
            <label for="ccv">CCV</label>
            <input class="inp" type="password" id="ccv" name="ccv" required />
          </div>
        </div>

        <input
          class="inp button"
          value="Checkout"
          type="button"
          style="width: 30%"
          id="checkoutbtn"
        />
      </div>

      <div
        id="win"
        style="
          display: flex;
          flex-direction: column;
          border-radius: 0px;
          font-size: 14px;
          display: none;
        "
      >
        <div class="winbox">
          <img class="backImage" />
          <img class="frontImage" />
          <a class="gift-link" target="_blank" href="">Gift Certificate</a>
        </div>
      </div>
    </div>
  </body>
</html>
